import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import UnPokemon from './Components/UnPokemon.js';

class App extends Component {
  state = {
    pokemon: {},
  }

  render() {
    if (i < 10)
      i++
    return (
      <div className="App">
        <UnPokemon pokeId={i} />
      </div>
    );
  }
}

export default App;
